import React from 'react';
import ReactDom from 'react-dom';
import App from './app';

import { Provider } from './react-redux';
import store from './redux/store';

ReactDom.render(
    <React.StrictMode>
        <Provider store={store}>
            <App />

        </Provider>
    </React.StrictMode>,
    document.getElementById("root")
);
